        function getCollectedIds() {

        function getMarkerColor(num) {
            return availableMarkerColors[num % availableMarkerColors.length - 2];
        }

        function refreshAllMapPoints() {
            Object.keys(invaders).forEach(key => {
                refreshMarker(key);
            });
            document.getElementById('map-legend-users').textContent = '';
            updateLegendCounts()
        }

        function refreshMarker(id) {
            let invader = invaders[id];

            updateSeenBy(id, foundInvadersUserLookup);

            // Icon.
            var customIcon = L.AwesomeMarkers.icon({
                "extraClasses": "",
                "icon": iconNames[invader.status] || 'wrench',
                "prefix": "fa",
                "iconColor": "white",
                "markerColor": markerColors[invader.status] || 'red',
                "prefix": "glyphicon"
            });
            const isCollected = collectedIds.has(id);

            if (invader.seenBy.size > 1) {
                customIcon.options.markerColor = getMarkerColor(invader.seenBy.size);
                customIcon.options.extraClasses = `fa-solid fa-${invader.seenBy.size}`;
            } else if (invader.seenBy.size == 1) {
                let userName = [...invader.seenBy][0]
                customIcon.options.extraClasses = `fa-solid fa-${userName[0]}`;
                customIcon.options.markerColor = foundInvadersUserLookup[userName]['markerColor']
            }

            invader.marker.setIcon(customIcon);

            // Popup.
            var popupContent = `<h4>${invader.id} (${invader.status})</h4>`;
            if (invader.hint) {
                popupContent += `<p><i>${invader.hint}</i></p>`;
            }
            popupContent += `<p>`;

            if (invader.seenBy.size == 1) {
                popupContent += `ðŸ‘¤ ${[...invader.seenBy]}`;
            } else if (invader.seenBy.size > 1) {
                popupContent += `ðŸ‘¥ ${[...invader.seenBy].join(', ')}`;
            }
            popupContent += `</p>`;
            popupContent += `<a href="${invader.instagramUrl}" target="_blank"><button>ðŸ“· Peek at Instagram</button></a></div>`;
            invader.marker.bindPopup(`<div>` + popupContent + `</div>`);

            // Visibility.
            var curZoom = map.getZoom();
            const isFlashable = invader.status == "OK" || invader.status == "damaged";
            let shouldBeVisible = (
                (!hideCollected || (!isCollected && isFlashable)) /*&&
                    (invader.salient || curZoom > 14)*/
            );
            if (shouldBeVisible && !invader.visible) {
                // markers.addLayer(invader.marker);
                invader.marker.addTo(map);
                invader.visible = true;
            } else if (!shouldBeVisible && invader.visible) {
                // markers.removeLayer(invader.marker);
                invader.marker.remove();
                invader.visible = false;
            }
        }

        function updateSeenBy(invader_id, userLists) {
            let invader = invaders[invader_id];
            invader.seenBy = new Set([]);
            // for each user in foundInvadersUserLookup, use invader id to add their username to invader.seenBy
            for (const [user, userData] of Object.entries(userLists)) {
                if (userData["visible"] && userData["foundInvaders"].includes(invader_id)) {
                    invader.seenBy.add(user);
                }
            };
        }
        function updateLegendCounts() {
            let commonInvaderCount = {}
            let foundInvadersCount = {}

            for (const [id, invader] of Object.entries(invaders)) {
                if (invader.seenBy.size > 1) {
                    commonInvaderCount[invader.seenBy.size] = (commonInvaderCount[invader.seenBy.size] || 0) + 1;
                } else {
                    for (const user of invader.seenBy) {
                        foundInvadersCount[user] = (foundInvadersCount[user] || 0) + 1;
                    }
                }
            }

            for (const [numberOfUsers, count] of Object.entries(commonInvaderCount)) {
                appendCombinedCountToLegend(numberOfUsers, getMarkerColor(numberOfUsers), count);
            }

            for (const [user, userData] of Object.entries(foundInvadersUserLookup)) {
                appendUserToLegend(
                    user,
                    user[0].toLowerCase(),
                    userData['markerColor'],
                    foundInvadersCount[user] || 0,
                    userData['foundInvaders'].length,
                    userData["visible"]
                );
            }
        }
        function checkboxClicked(checkbox) {
            if (checkbox.checked) {
                foundInvadersUserLookup[checkbox.value].visible = true;
            } else {
                foundInvadersUserLookup[checkbox.value].visible = false;
            }
            refreshAllMapPoints()
        }
        function appendUserToLegend(displayText, icon, markerColor, invaderOnMapCount, totalInvaderCount, visible) {
            let mapLegend = document.getElementById('map-legend-users');

            let legendEntry = document.createElement('div');
            legendEntry.classList.add('map-legend-item');

            legendEntry.innerHTML = `
            <input id="${displayText}-checkbox" value="${displayText}" onclick="checkboxClicked(this)" type="checkbox" ${visible ? 'checked' : ""}>
            <div class="awesome-marker-icon-${markerColor} awesome-marker" tabindex="0"><i class="fa-solid fa-${icon} icon-white"></i></div>
            <div class="legend-item-text">${displayText}</div>
            <div class="legend-item-text">${invaderOnMapCount}</div>
            <div class="legend-item-text">(Total: ${totalInvaderCount})</div>
            `;

            mapLegend.appendChild(legendEntry);
            legendElements[displayText] = legendEntry;
        }

        function appendCombinedCountToLegend(icon, markerColor, invaderOnMapCount) {
            let mapLegend = document.getElementById('map-legend-users');

            let legendEntry = document.createElement('div');
            legendEntry.classList.add('map-legend-item');

            legendEntry.innerHTML += `
            <div class="awesome-marker-icon-${markerColor} awesome-marker" tabindex="0"><i class="fa-solid fa-${icon} icon-white"></i></div>
            <div class="legend-item-text">${invaderOnMapCount}</div>
            `;

            mapLegend.appendChild(legendEntry);
        }

        function addMarker(map, item) {
            // Create the marker.
            var marker = L.marker([item.obf_lat, item.obf_lng]);

            invaders[item.id] = item;
            invaders[item.id].marker = marker;
            // Markers start off as not visible (not added to the map). This will
            // be changed in refreshMarker.
            invaders[item.id].visible = false;

            refreshMarker(item.id);
        }
